def appendwp(lst, wp):
    lastwp = lst[-1]
    print(wp[-1])
    if any([abs(lastwp[j] - wp[j]) > np.pi for j in range(8)]):
        #print(lastwp[j])
        appendwp(lst, [(lastwp[j] + wp[j])/2 for j in range(8)])
        appendwp(lst, wp)
    else:
        lst.append(wp)

